INSERT INTO `cmdb_ci` VALUES (479572181131264, 'Team', '分组', NULL, 'tsfont-ci', 482263699349504, NULL, NULL, 2, 3, 0, 0, 0, 1, 932634431594496, '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<ci>\n   <!--模型属性定义，需要SQL语句返回对应列-->\n  <attrs>\n    <attr name=\"team_uuid\" label=\"分组uuid\"/>\n    <attr name=\"team_name\" label=\"分组名\"/>\n  </attrs>\n  <sql>\n    SELECT\n    <!--必须包含id字段，作为配置项主键-->\n    `t`.`id` as id,\n    <!--必须包含uuid字段，数据类型是char(32)，作为配置项全局主键-->\n    `uuid` as uuid,\n    <!--必须包含name字段，作为配置项名称-->\n    `t`.`name` AS name,\n    <!--属性列需要在上面attrs中定义才生效-->\n    `t`.`uuid` as team_uuid,\n    `t`.`name` AS team_name\n    FROM\n    `team` `t` \n  </sql>\n</ci>', 0);
