INSERT INTO `cmdb_ci` VALUES (479643459133440, 'User', '用户', NULL, 'tsfont-ci', 482263699349504, NULL, NULL, 4, 5, 0, 0, 0, 1, 932634549035008, '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<ci>\n   <!--模型属性定义，需要SQL语句返回对应列-->\n  <attrs>\n    <attr name=\"user_id\" label=\"用户id\"/>\n    <attr name=\"user_name\" label=\"用户名\"/>\n    <attr name=\"teamName\" label=\"分组\"/>\n  </attrs>\n  <sql>\n    SELECT\n    <!--必须包含id字段，作为配置项主键-->\n    `u`.`id` AS id,\n    <!--必须包含uuid字段，数据类型是char(32)，作为配置项全局主键-->\n    md5(`u`.`id`) AS uuid,\n    <!--必须包含name字段，作为配置项名称-->\n    `u`.`user_name` AS name,\n    <!--属性列需要在上面attrs中定义才生效-->\n    `u`.`user_id` as user_id,\n    `u`.`user_name` as user_name,\n    group_concat( `t`.`name`) AS teamName\n    FROM\n    `user` `u`\n    LEFT JOIN `user_team` `ut` \n    ON `u`.`uuid` = `ut`.`user_uuid`\n    LEFT JOIN `team` `t` \n    ON `t`.`uuid` = `ut`.`team_uuid`\n    GROUP BY u.uuid\n  </sql>\n</ci>', 0);
INSERT INTO `cmdb_ci` VALUES (479644625149952, 'Department', '部门', NULL, 'tsfont-ci', 482263699349504, NULL, NULL, 6, 7, 0, 0, 0, 1, 932634700029952, '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<ci>\n   <!--模型属性定义，需要SQL语句返回对应列-->\n  <attrs>\n    <attr name=\"team_uuid\" label=\"分组uuid\"/>\n    <attr name=\"team_name\" label=\"分组名\"/>\n  </attrs>\n  <sql>\n    SELECT\n    <!--必须包含id字段，作为配置项主键-->\n    `t`.`id` as id,\n    <!--必须包含uuid字段，数据类型是char(32)，作为配置项全局主键-->\n    `uuid` as uuid,\n    <!--必须包含name字段，作为配置项名称-->\n    `t`.`name` AS name,\n    <!--属性列需要在上面attrs中定义才生效-->\n    `t`.`uuid` as team_uuid,\n    `t`.`name` AS team_name\n    FROM\n    `team` `t` \n    where `t`.level = \'department\'\n  </sql>\n</ci>', 0);
